import React from 'react';

function Repo({repo, setDescription, removeRepo}) {
    return (
        <div
            className="repo"
            onClick={() => setDescription(repo.description)}
        >
            <h3>{repo.name}</h3>
            <div
                onClick={removeRepo}
            >
                X
            </div>
        </div>
    );
}

export default Repo;
